import 'bootstrap/dist/css/bootstrap.min.css'
import className from 'classnames'

export default class Navi extends Component {
  render() {
    return (
      <div>
          <div className={`form-group`}>
            <p>deneme</p>
            </div>
      </div>
    )
  }
}
